import React, { Component } from 'react';

import Head from 'next/head';

class TeamsFooter extends Component {
    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div class="bottom-block" style="background-image:url(images/img17.jpg);">
                    <div class="container">
                        <div class="textblock">
                            <h3>Try Aesthetic Record with your team for free </h3>
                            <a href="#" class="btn full">Get Started</a>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default TeamsFooter;
